  true,\n\t\"url\": null,\n\t\"notes\": \"The Global Rural-Urban Mapping Project,
  Version 1 (GRUMPv1) consists of estimates of human population for the years 1990,
  1995, and 2000 by 30 arc-second (1km) grid cells and associated datasets dated circa
  2000. National Administrative boundaries are derived from the land area grid to
  show the outlines of pixels (cells) that contain administrative units in GRUMPv1
  on a per-country/territory basis. The National boundaries data are derived from
  the pixels as polygons and thus have rectilinear boundaries at large scale. Note
  that the polygons that outline the countries and territories are not official representations;
  rather they represent the area covered by the statistical data as provided. This
  dataset is produced by the Columbia University Center for International Earth Science
  Information Network (CIESIN) in collaboration with the International Food Policy
  Research Institute (IFPRI), The World Bank, and Centro Internacional de Agricultura
  Tropical (CIAT).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
